import React from 'react';
import { NavLink } from 'react-router-dom';
import CN from 'classnames';

export const Wrapper = ({ children }) => (
	<section className="w-80 center mt4 flex justify-between flex-wrap">
		{children}
	</section>
);

export const Card = ({ back, title, to, color }) => (
	<NavLink to={to} className="mb3 flex items-center justify-center w-32 h7 bg-">
		<div className={CN('absolute pa3 futura ttu fw7 f1 z-max', color)}>
			{title}
		</div>

		<img src={back} alt="prj" className="obj-cover z-2" />
	</NavLink>
);
